;(function($) {

	$.fn.pluginName = function(options) {  

		var defaults = {
			propertyName : 'value',
		};

		return this.each(function() {

			var $this = $(this);        
		
			if (options) { 
				$.extend(defaults, options);
			}

		});

		var debug = function ($obj) {
			if (window.console && window.console.log) {
				window.console.log('Debug: ' + $obj);
			}
		};

	};

})(jQuery);


